import React from 'react'
import FlowerTable from './FlowerTable';
import { useState, useEffect } from 'react';
import axios from 'axios'

const AdminHomePage = () => {

  const [arrangements, setArrangement] = useState();
  useEffect(() => {
      if(arrangements == null) {
          axios.get("api/arrangements").then((res) => {
              console.log(res.data);
              setArrangement(res.data.arrangements);
          });
      }
  }, [arrangements]);

  return (
    <div>

{arrangements == null ? <></> : arrangements.map((data) => <FlowerTable data={data} key={data.arrangement_id}/>)}

    
        <thead className="bg-light">
          <tr>
            
            <th>{data.arrangement_id}</th>
            <th>{data.name}</th>
            <th>{data.description}</th>
            <th>{data.quantity}</th>
            <th>{data.price}</th>
            <th>{data.url}</th>
            <th>{data.category_id}</th>
            <th>{data.flower_id}</th>
            <th>Odaberi</th>
          </tr>
        </thead>
      


    </div>

    )
}

export default AdminHomePage
